import { createStyles, makeStyles, Theme } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    container: {
      marginTop: theme.spacing(2),
    },
    table: {
      minWidth: 650,
    },
    tableSpace: {
      marginTop: 20,
    },
  })
);

function Home() {
  const classes = useStyles();

  return (
    <div>
      <Container className={classes.container} maxWidth="md">
        <h1 style={{ textAlign: "center" }}>ระบบจองห้องพัก</h1>
        <h4>Requirements</h4>
        <p>
        ระบบโรงแรมสุรนารี โรงแรมที่มีชื่อเสียงและมีคุณภาพระดับห้าดาว เป็นระบบที่ลูกค้าที่มีความสนใจ เข้าพักกับโรงแรมนี้สามารถ login เข้าสู่ระบบสมาชิกผ่านทางเว็บไซต์ของโรงแรม เพื่อทําการจองห้องพกั ภายในโรงแรมได้อย่างง่ายดาย สะดวกและรวดเร็ว ทําการชําระเงิน Check-in, Check-out และใช้บริการทํา ความสะอาดได้
        <p>ระบบจองห้องพักของโรงแรมสุนารีลูกค้าสามารถระบุวันเวลาที่ต้องการเข้าพกั รูปแบบของห้องพัก ภายในโรงแรมจํานวนคนที่ต้องการเข้าพักและยังสามารถเลือกช่องทางการชําระเงนิ รวมไปถึงระบุชื่อผู้จอง ห้องพักได้อกี ด้วย จากนั้นระบบจะทําการบันทึกข้อมูลการจองห้องพักให้กับลูกค้า
        </p>
        </p>
      </Container>
    </div>
  );
}
export default Home;
